export function login({ username, password }) {
    const formdata = new FormData()
    formdata.append("cqupt_id", "1672946")
    formdata.append("password", "2")
    fetch('/dev/login', {
        method: "POST",
        headers: {
            "Content-Type": "form-data",
            "traefik": "user"
        },
        body: formdata
    }).then((res) => {
        console.log(res)
    })
}
